INSERT INTO `Template` VALUES (1,'Infosessie_ingeschreven','','<html>\n    <h3>Inschrijving infosessie gelukt!</h3>\n    <p>Beste {{name}},</p>\n    <p>Je bent succesvol ingeschreven voor een infosessie bij Edran!</p>\n    <p>Dit zijn de details van de infosessie:</p>\n    <table>\n        <tr>\n            <td class=\"infosession_description\">Locatie:</td>\n            <td class=\"infosession_content\">{{infosession.address}}</td>\n        </tr>\n        <tr>\n            <td class=\"infosession_description\">Datum:</td>\n            <td class=\"infosession_content\">{{infosession.date}}</td>\n        </tr>\n    </table>\n    <p>Tot dan!</p>\n    <p>Met vriendelijke groeten,</p>\n    <p>Het <b>Edran</b>-team.</p>\n</html>','2014-05-18 20:56:06');
INSERT INTO `Template` VALUES (2,'Infosessie_verandering','','<html>\n    <h3>Wijziging van de infosessie</h3>\n    <p>Beste {{name}}</p>\n    <p>Onlangs schreef je je in voor een infosessie bij Edran. De tijd en/of locatie van deze infosessie zijn gewijzigd.</p>\n    <p>Dit zijn de nieuwe gegevens van de infosessie:</p>\n    <table>\n        <tr>\n            <td class=\"infosession_description\">Locatie:</td>\n            <td class=\"infosession_content\">{{infosession.address}}</td>\n        </tr>\n        <tr>\n            <td class=\"infosession_description\">Datum:</td>\n            <td class=\"infosession_content\">{{infosession.date}}</td>\n        </tr>\n    </table>\n    <p>Tot dan!</p>\n    <p>Met vriendelijke groeten,</p>\n    <p>Het <b>Edran</b>-team.</p>\n</html>','2014-05-18 20:56:06');
INSERT INTO `Template` VALUES (3,'Infosessie_herinnering','','<html>\n<h3>Infosessie aanstaande!</h3>\n    <p>Beste {{name}},</p>\n    <p>We sturen jou nog eens een mailtje met de melding dat er binnenkort een infosessie plaatsvindt waar jij voor bent ingeschreven!</p>\n    <p>Dit zijn nog eens de details van de infosessie:</p>\n    <table>\n        <tr>\n            <td class=\"infosession_description\">Locatie:</td>\n            <td class=\"infosession_content\">{{infosession.address}}</td>\n        </tr>\n        <tr>\n            <td class=\"infosession_description\">Datum:</td>\n            <td class=\"infosession_content\">{{infosession.date}}</td>\n        </tr>\n    </table>\n    <p>Tot dan!</p>\n    <p>Met vriendelijke groeten,</p>\n<p>Het <b>Edran</b>-team.</p>\n</html>','2014-05-18 20:56:06');
INSERT INTO `Template` VALUES (4,'Registratie','','<html>\n    <h3>Welkom bij Edran, {{name}}!</h3>\n    <p>Je account is succesvol aangemaakt, je kan nu je emailadres verifiÃ«ren <a href=\"https://edran.ugent.be/dev/verifymail/{{token}}\">door hier te klikken</a>, hierna kan je je ook inschrijven voor een infosessie of een auto registreren.</p>\n    <p>Tot snel!</p>\n    <small><p>Deze link blijft een week geldig na jouw registratie.</p></small>\n    <hr>\n    <small><cite title=\"DÃ©gage\">Het DÃ©gage-team</cite></small>\n    <p><small>Als bovenstaande link niet werkt gelieve dan deze link in jouw adresbalk te kopiÃ«ren.</small></p>\n    <p>https://edran.ugent.be/dev/verifymail/{{token}}</p>\n</html>','2014-05-18 20:56:06');
INSERT INTO `Template` VALUES (5,'KwartaalRekening','','<html>\n    <h3>Beste {{name}}</h3>\n    <p>Er is alweer een kwartaal voorbij. Bijgevolg sturen we jou een mailtje met de melding dat de afrekening op onze website beschikbaar is.<p>\n    <p>Tot snel</p>\n    <small><cite title=\"DÃ©gage\">Het DÃ©gage-team</cite></small>\n</html>','2014-05-18 20:56:06');
INSERT INTO `Template` VALUES (6,'Openstaande_notificaties','','<html>\n    <h3>{{name}}, je hebt {{message.size}} ongelezen berichten!</h3>\n    <p>Beste {{name}},</p>\n    <p>Een aantal berichten wachten op jouw aandacht. Log je in op <a href=\"http://edran.ugent.be/\">je dashboard</a> om je ongelezen berichten te bekijken.</p>\n    <p>Hier alvast een overzicht:\n        {{notifications}}\n    </p>\n    <p></p><p>Met vriendelijke groeten,</p>\n    <p>Het <b>Edran</b>-team.</p>\n</html>','2014-05-18 20:56:06');
INSERT INTO `Template` VALUES (7,'Wachtwoord_reset','','<html>\n    <h3>Aanvraag om het wachtwoord te resetten.</h3>\n    <p>Beste {{name}},</p>\n    <p>Iemand heeft aangevraagd om het wachtwoord geassocieerd met dit emailadres te wijzigen.</p>\n    <p>Dit kan <a href=\"https://edran.ugent.be/dev/resetPassword/{{token}}\"> hier </a> </p>\n   <p><small>Was jij dit niet, gelieve deze mail dan te negeren.</small> </p>\n    <p></p><p>Met vriendelijke groeten,</p>\n    <p>Het <b>Edran</b>-team.</p>\n    <p><small>Als bovenstaande link niet werkt gelieve dan deze link in uw adresbalk te kopiÃ«ren.</small></p>\n    <p>https://edran.ugent.be/dev/resetPassword/{{token}}</p>\n</html>','2014-05-18 20:56:06');
INSERT INTO `Template` VALUES (8,'Bevestig_ritten','','<html>\n<h3>Ritten bevestigen</h3>\n<p>Beste {{name}},</p>\n<p>We sturen je een mailtje daar er binnenkort een afrekening komt en bijgevolg het belangrijk is dat alle ritten bevestigd worden.\n</p>\n<p>Tot dan!</p>\n<p>Met vriendelijke groeten,</p>\n<p>Het <b>Edran</b>-team.</p>\n</html>\n','2014-05-18 20:56:06');
